machine_start_gcode:
MMU_START_SETUP INITIAL_TOOL={initial_tool} TOTAL_TOOLCHANGES=!total_toolchanges! REFERENCED_TOOLS=!referenced_tools! TOOL_COLORS=!colors! TOOL_TEMPS=!temperatures! TOOL_MATERIALS=!materials! FILAMENT_NAMES=!filament_names! PURGE_VOLUMES=!purge_volumes!

{if curr_bed_type=="Cool Plate"}
  ;Cool Plate Offset  
  SET_GCODE_OFFSET Z=-0.085
{else}
  {if curr_bed_type=="Textured Cool Plate"}
    ;Cool Plate Offset  
    SET_GCODE_OFFSET Z=-0.240
  {else}
    SET_GCODE_OFFSET Z=0.0
  {endif}
{endif}

PRINT_START HOTEND=[first_layer_temperature[initial_extruder]] BED=[first_layer_bed_temperature] CHAMBER=[chamber_temperature]
